import { Route, useParams } from "react-router-dom";
import Comments from "../components/comments/Comments";
const QuoteDetails = () => {
  const params = useParams();
  return (
    <div>
      <h1> quote details</h1>
      <p>{params.quoteId}</p>
      <Route path={`/all-quotes/${params.quoteId}/comments`}>
        <Comments></Comments>
      </Route>
    </div>
  );
};
export default QuoteDetails;
